    "2016-07-27T22:45:25.737887",nt"name": "narrative-report-crescent-lake-national-wildlife-refuge-september-october-november-decemb--842de",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1948. The report begins by summarizing the weather conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include grazing,
    haying, and fur harvesting. The public relations section of the report describes
    recreational uses, Refuge visitors, hunting, and violations. N-R forms are attached.",nt"license_title":
